    false,nt"url": null,nt"notes": "This plan is written to provide guidelines
    for appropriate wildland fire suppression and prescribed fire programs. Prescribed
    fires may be used to reduce hazard fuels, restore natural processes and vitality
    of ecosystems, improve wildlife habitat, remove or reduce non-native species, and
    conduct research.  Major components include:  u2013 updated policy for prescribed
    fires at the Refuge will be completed after environmental documentation,  Section
    7 consultation and the FMP is amended  u2013 implementation of objectives set forth
    in the Refugeu2019s Habitat Management Plans  u2013 implementation of format changes
    under the direction of the USDI Fish and Wildlife Service Fire  Management Handbook
    (Release Date 6/1/00)  u2013 establishment of policy and procedure for wildland
    fire suppression and prevention for the Refuge  u2013 establishment of a prescribed
    fire program to manage critical habitat and reduce hazardous fuels  u2013 establishment
    of policy and procedure for burning debris.  This document is a revision of the
    previous approved Fire Management Plan (1989, revised 1991) for the Modoc National
    Wildlife Refuge.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
